import React from "react";
import "./card.css";

const Stops = () => {
  const [checked, setChecked] = React.useState(false);

  const handleChange = () => {
    setChecked(!checked);
    console.log(checked);
  };

  return (
    <div className="Card" style={{ width: "227px", height: "232px" }}>
      <h3>Количество пересадок</h3>
      <div className="StopsCB">
        <Checkbox
          label="Без пересадок"
          value={checked}
          onChange={handleChange}
        />
        <Checkbox
          label="Без пересадок"
          value={checked}
          onChange={handleChange}
        />
        <Checkbox
          label="Без пересадок"
          value={checked}
          onChange={handleChange}
        />
        <Checkbox
          label="Без пересадок"
          value={checked}
          onChange={handleChange}
        />
      </div>
    </div>
  );
};

const Checkbox = ({ label, value, onChange }) => (
  <div className="CheckboxWrapp">
    <label>
      <input type="checkbox" checked={value} onChange={onChange} />
      {label}
    </label>
  </div>
);

export default Stops;
